const paths = {
    path: {
        sign_in: "/signin",
        sign_up: "/signup",
        crear_auditoria: "/crear-auditoria",
        areas: "/",
        crear_pregunta: "/crear-pregunta",
        auditorias: "/auditoria/:id"
    },
    text: {
        sign_in: "Login",
        sign_up: "SignUp",
        crear_auditoria: "Crear auditoría",
        areas: "Areas",
        crear_pregunta: "Crear pregunta",
        auditorias: "Auditorias"
    }
}

export default paths
